import React from "react";
import product from "../../assets/images/banners/product.png";

export default function CardItem() {
  return (
    <div className="card">
      <div class="card-item row">
        <div className="check col-sm-5">
          <lable>Tất cả (5 sản phẩm)</lable>
        </div>
        <div className="price col-sm-2"></div>
        <div className="amount col-sm-2"></div>
        <div className="total col-sm-2"></div>
        <div className="delete col-sm-1"></div>
      </div>
    </div>
  );
}
